    [SerializeField]
    private GameObject BlockPrefab;
    // Use this for initialization
    void Awake ()
    {
        DontDestroyOnLoad(this);
        for (int i = 0; i < 1500; i++)
            InstantiateBlock();
    }
    void Start () {

        DontDestroyOnLoad(this);
       

      
	}
	
	// Update is called once per frame
	void Update () {
        if (!IsMaking)
        {
            IsMaking = true;
            StartCoroutine(MakeMaze(maze));
        }
        if(IsCompleted)
        {
            AppearBlock();
        }
	}
  
    public IEnumerator MakeMaze(int[,] maze)
    {
        position = Fposition;
        for (int j = 0; j < MAXWIDTH; j++)
        {
            for (int i = 0; i < MAXHEIGHT; i++)
            {
                percent++;
                if (maze[i, j] != 0)
                {
                    ActivateBlock();
                    yield return new WaitForFixedUpdate();
                    yield return new WaitForFixedUpdate();
                    DestroyBlock();
                   
                }
                position = position + new Vector3(0, -Y, 0);
            }
            position = Fposition + new Vector3(X * (j + 1), 0, 0);
        }
        IsCompleted = true;
    }

    public void InstantiateBlock()
    {
        GameObject block = (GameObject)Instantiate(BlockPrefab, Fposition, Quaternion.Euler(new Vector3(0, 0, 0)));
        block.SetActive(false);
        madeblocks.Add(block);
    }

    public void ActivateBlock()
    {
        activeblocks.Add(madeblocks[madeblocks.Count - 1]);
        madeblocks.RemoveAt(madeblocks.Count - 1);

        activeblocks[activeblocks.Count - 1].SetActive(true);
        activeblocks[activeblocks.Count - 1].transform.position = position;
    }

    public void DestroyBlock()
    {
        if (activeblocks[activeblocks.Count - 1].gameObject.GetComponent<Blocks>().collision) //겹쳐서 없어질 때
        {
            activeblocks[activeblocks.Count - 1].SetActive(false);

            madeblocks.Add(activeblocks[activeblocks.Count - 1]);
            activeblocks.RemoveAt(activeblocks.Count - 1);

       

            if (activeblocks.Count - p > MAXACTIVENUM )
            {
                activeblocks[p].SetActive(false);
                p++;
            }
        }
       
    }

    public void AppearBlock()
    {
        for (int i = 0; i < activeblocks.Count; i++)
        {
            Vector3 viewPos = Camera.main.WorldToViewportPoint(activeblocks[i].transform.position);


            if ((viewPos.x >= -0.15f && viewPos.x <= 1.15f) && (viewPos.y >= -0.15f && viewPos.y <= 1.15f))
            {
                activeblocks[i].SetActive(true);
            }
            else
                activeblocks[i].SetActive(false);
        }
    }



